def intersection(interval1, interval2):
    """Determine if the length of the intersection of two intervals is a prime number."""
    if interval1[1] < interval2[0] or interval2[1] < interval1[0]:
        return "NO"

    intersection_start = max(interval1[0], interval2[0])
    intersection_end = min(interval1[1], interval2[1])
    intersection_length = intersection_end - intersection_start + 1

    if intersection_length <= 1:
        return "NO"

    if intersection_length == 2:
        return "YES"

    for i in range(2, int(intersection_length**0.5) + 1):
        if intersection_length % i == 0:
            return "NO"
    return "YES"

def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]

    def neighbors(r, c):
        for dr, dc in moves:
            nr, nc = r + dr, c + dc
            if 0 <= nr < N and 0 <= nc < N:
                yield nr, nc

    def bfs():
        pq = [(grid[i][j], i, j, 1, [grid[i][j]]) for i in range(N) for j in range(N)]
        seen = set()

        while pq:
            val, r, c, length, path = heappop(pq)
            if (r, c, length) in seen:
                continue
            seen.add((r, c, length))
            if length == k:
                return path
            for nr, nc in neighbors(r, c):
                new_path = path + [grid[nr][nc]]
                heappush(pq, (val, nr, nc, length + 1, new_path))

    return bfs()

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [1]
    seq = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            seq.append(1 + i / 2)
        else:
            seq.append(seq[i - 1] + seq[i - 2] + seq[i - 3] if i >= 3 else seq[i - 1] + seq[i - 2] + 3)
    return seq[:n + 1]

