from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]

    def isValid(row, col):
        return 0 <= row < N and 0 <= col < N

    pq = []
    for i in range(N):
        for j in range(N):
            heappush(pq, (grid[i][j], i, j, [grid[i][j]]))

    while pq:
        value, row, col, path = heappop(pq)
        if len(path) == k:
            return path
        for dr, dc in directions:
            newRow, newCol = row + dr, col + dc
            if isValid(newRow, newCol) and len(path) < k:
                newPath = path + [grid[newRow][newCol]]
                heappush(pq, (newPath[len(path)], newRow, newCol, newPath))

