def minPath(grid, k):
    N = len(grid)
    path = [float('inf')] * k
    visited = [[False] * N for _ in range(N)]

    def isValidCell(row, col):
        return 0 <= row < N and 0 <= col < N and not visited[row][col]

    def dfs(row, col, curr_path, step):
        nonlocal path
        if step == k:
            path = min(path, curr_path)
            return
        visited[row][col] = True
        for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            newRow, newCol = row + dr, col + dc
            if isValidCell(newRow, newCol):
                dfs(newRow, newCol, curr_path + [grid[newRow][newCol]], step + 1)
        visited[row][col] = False

    for row in range(N):
        for col in range(N):
            dfs(row, col, [grid[row][col]], 1)

    return path

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [3]
    seq = [3]
    for i in range(1, n + 1):
        if i % 2 == 0:
            seq.append(1 + i / 2)
        else:
            if i == 1:
                seq.append(seq[i - 1])
            elif i == 2:
                seq.append(seq[i - 1] + seq[i - 2] + 1)  # tri(3) needs tri(4) which is not calculated yet.
            else:
                seq.append(seq[i - 1] + seq[i - 2] + seq[i - 3])
    return seq

