def select_words(s, n):
    """Given a string s and a natural number n, returns a list of all words from string s that contain exactly n consonants."""
    words = []
    if not s:
        return words
    for word in s.split():
        consonant_count = sum(ch.lower() not in 'aeiou ' for ch in word)
        if consonant_count == n:
            words.append(word)
    return words

def get_closest_vowel(word):
    closest_vowel = ""
    vowels = ['a', 'e', 'i', 'o', 'u', 'A', 'E', 'I', 'O', 'U']
    last_consonant_index = -1
    for i in range(len(word) - 1, -1, -1):
        if word[i] not in vowels:
            last_consonant_index = i
        elif word[i] in vowels and last_consonant_index != -1:
            closest_vowel = word[i]
            break
    return closest_vowel

def match_parens(lst):
    '''
    Input: lst: a list of two strings
    Output: result: 'Yes' or 'No'
    '''
    # Check if concatenating in both orders can create a balanced string
    for order in [0, 1]:
        stack = []
        for i in [0, 1]:
            for char in lst[(i + order) % 2]:
                if char == '(':
                    stack.append(char)
                elif char == ')':
                    if stack:
                        stack.pop()
                    else:
                        break
            else:
                continue
            break
        else:
            if not stack:
                return 'Yes'
    return 'No'

