    try:
        parts = date.split('-')
        if len(parts) != 3:
            return False
        month, day, year = parts
        month, day, year = int(month), int(day), int(year)
        if month < 1 or month > 12:
            return False
        if day < 1:
            return False
        if month in [1, 3, 5, 7, 8, 10, 12] and day > 31:
            return False
        elif month in [4, 6, 9, 11] and day > 30:
