def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    max_start = max(interval1[0], interval2[0])
    min_end = min(interval1[1], interval2[1])
    if max_start > min_end:
        return "NO"

    length = min_end - max_start + 1
    return "YES" if is_prime(length) else "NO"

def prod_signs(arr):
    if not arr:
        return None
    sum_magnitudes = 0
    product_signs = 1
    for num in arr:
        sum_magnitudes += abs(num)
        product_signs *= (1 if num > 0 else -1 if num < 0 else 0)
    return sum_magnitudes * product_signs

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    sequence = [1, 3, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            sequence.append(1 + i / 2)
        else:
            sequence.append(sequence[-1] + sequence[-2] + sequence[-3])
    return sequence

def is_nested(string):
    stack = []
    for ch in string:
        if ch == '[':
            stack.append(ch)
        elif ch == ']':
            if not stack:
                return False
            stack.pop()
    return len(stack) > 0

