        return None
    if isinstance(a, (int, float)):
        if a > b:
            return a
        elif b > a:
            return b
        else:
            return None
    elif isinstance(a, str):
        a_float = float(a.replace(',', '.'))
        b_float = float(b.replace(',', '.'))
        if a_float > b_float:
